Filter documents with a property that can be or true or null MongoDB<p>I have this query:</p>
<pre><code>collection.aggregate([
    { $match:{ &quot;card.discovery&quot;: true } }
    { $sample: { size: 4 } }
]);
</code></pre>
<p>And it works because I need to get 4 random entries from that collection, but <code>card.discovery</code> can be <code>true</code> or <code>null</code>, and this obviously only returning documents with <code>card.discovery</code> set to <code>true</code>.</p>
<p>How can I filter the documents so that <code>card.discovery</code> can be or <code>true</code> or <code>null</code>?</p>

answer:
try something like:
"make 2>&1 | grep line"       to get the line numbers
or grep for "error" if you want to know the error codes

