mongo $cond with subfields<p>I have the following data in my db (with irrelevant fields removed).</p>
<pre><code>{
  &quot;multiclass&quot;: {
    &quot;datasetname&quot;: {
      &quot;labels&quot;: {
        &quot;al&quot;: {
          &quot;timestamp&quot;: {
            &quot;$date&quot;: {
              &quot;$numberLong&quot;: &quot;1628689826073&quot;
            }
          },
          &quot;classification&quot;: &quot;wrong_ingredient&quot;
        },
        &quot;bob&quot;: {
          &quot;timestamp&quot;: {
            &quot;$date&quot;: {
              &quot;$numberLong&quot;: &quot;1628765248010&quot;
            }
          },
          &quot;classification&quot;: &quot;wrong_ingredient&quot;
        }
      }
    }
  }
}
</code></pre>
<p>I'd like to know if a document that hasn't been given a label by candice has been given a sufficient number of labels by other labelers. In this case, both al and bob have labeled it, so it should return 2, which is less than 3, so this document should be included.
Here's the query I've written.</p>
<pre><code>{
  &quot;multiclass.datasetname.labels.candice&quot;: {$exists: false},
  $expr: {
    $lt: [
      {
        $cond: {
          if: {&quot;multiclass.datasetname.labels&quot;: {$exists: true}},
          then: {$size: {$objectToArray: &quot;$multiclass.datasetname.labels&quot;}},
          else: 0
        }
      },
      3
    ]
  }
}
</code></pre>
<p>Running this results in the error <code>FieldPath field names may not contain '.'. Consider using $getField or $setField.</code> (which refers the the line <code>if: {&quot;multiclass.datasetname.labels&quot;: {$exists: true}},</code> and not to the line <code>&quot;multiclass.datasetname.labels.candice&quot;: {$exists: false}</code>)
I do not know what this error is trying to get across, except perhaps it thinks I'm trying to access an element with dots in it's name, rather than trying to access a field with a subfield with a subfield?</p>
<p>The questions I've seen on SO with related errors, such as <a href="https://stackoverflow.com/questions/42433120/fieldpath-field-names-may-not-contain-in-group">this one</a> give a work around for the specific problem, rather than an explanation of <em>why</em> it isn't working, which makes it difficult to apply to my situation.</p>
<p>So my question is primarily why can't I use dots inside the $expr, but I can use dots outside it?
If you can answer that question, a solution would also be useful, but it's much more important that I know why it doesn't work.</p>

