module.exports = {
    commands: ['listwarnings', 'listwarns', 'listwarn', 'lw'],
    minArgs: 1,
    expectedArgs: &quot;&lt;Target user's @&gt;&quot;,
    callback: async (message, arguments, text) =&gt; {
        const target = message.mentions.users.first()
